import React from "react";
import { Link } from "react-router-dom";
import ThemeSwitch from "./ThemeSwitch";

export default function Header({ toggleTheme }) {
    return (
        <header>
            <Link to="/" id="logo">
                Name To It
            </Link>
            <ThemeSwitch toggleTheme={toggleTheme} />
        </header>
    )
}
